import React from "react";

const ProductPage = () => {
  return (
    <div>
      <h2>Some of the product</h2>
      <ul>
        <li>Product 1</li>
        <li>Product 2</li>
        <li>Product 3</li>
      </ul>
    </div>
  );
};

export default ProductPage;
